INSERT INTO `new_feed_exer` VALUES (2,'ประโยชน์ของการออกกำลังกาย','  1. ด้านร่างกาย การออกกำลังกายจะทำให้อวัยวะและระบบต่างๆ ของร่างกายมีการเปลี่ยนแปลงและพัฒนาไปในทางที่ดีขึ้น ดังนี้ \n          1.1 ระบบกล้ามเนื้อ กล้ามเนื้อจะมีการเจริญเติบโตขึ้น ทำให้ขนาดของเส้นใยกล้ามเนื้อขยายใหญ่ขึ้น (Hypertrophy) และเป็นการเพิ่มความสามารถในการออกแรงด้วย ทำให้ประสิทธิภาพในการทำงานของกล้ามเนื้อเพิ่มขึ้น กล้ามเนื้อจะทำงานได้นานขึ้น เนื่องจากมีการใช้ออกซิเจนน้อยกว่า\n          1.2 ระบบโครงร่าง ในขณะออกกำลังกายกระดูกจะถูกดึง ถูกบีบจากแรงกล้ามเนื้อ ซึ่งจะกระตุ้นให้กระดูกมีการเจริญขึ้น ทั้งความกว้าง ความใหญ่ ความหนา และข้อต่อก็จะมีการเปลี่ยนแปลงให้เหมาะสมกับการทำงาน \n          1.3 ระบบไหลเวียนโลหิตและระบบหายใจ การออกกำลังกายเป็นประจำทำให้ระบบไหลเวียนโลหิตและระบบหายใจทำงานได้อย่างมีประสิทธิภาพ\n\n2. ด้านจิตใจ การออกกำลังกายอย่างสม่ำเสมอ จะผลทำให้เป็นคนที่มีบุคลิกที่มั่นคงสามารถปรับตัวเข้ากับสิ่งแวดล้อมได้ดี มีมนุษย์สัมพันธ์ที่ดีสามารถปรับตัวเมื่อได้รับความเครียดได้ดี มีความฉลาดทางอารมณ์ (EQ) ที่ในระดับดี\n\n          3. ด้านสติปัญญา นอกจากการออกกำลังกายมีผลต่อด้านจิตใจแล้ว ผู้ที่ออกกำลังกายอย่างสม่ำเสมอ จะมีความสามารถในการแก้ปัญหา มีความสามารถในการคิดอย่างสร้างสรรค์ \nมีความสามารถในการเรียนรู้ มีความสามารถในการปรับตัวเข้ากับเหตุการณ์ต่างๆได้ดี \n           4. ด้านสังคม การออกกำลังกายจะช่วยเพิ่มความมีวุฒิภาวะทางสังคม มีความฉลาดทางสังคม เนื่องการออกำลังกายเป็นกิจกกรมที่ส่งเสริมให้คนมีปฏิสัมพันธ์มากขึ้น จนนำไปสู่การพัฒนาทักษะทางสังคมที่ดี','http://34.126.141.128/images/feed/','http://34.126.141.128/images/new.jpg','2021-11-14'),(3,'ข้อดีของการอบอุ่นร่างกายทุกครั้งที่ออกกำลังกาย','· หัวใจ, หลอดเลือด, และระบบประสาทอัตโนมัติ ซึ่งควบคุมระบบต่าง ๆ ในร่างกาย มีการปรับตัวทั้งด้านอุณหภูมิ\n\nและการทำงาน\n\n· ป้องกันอันตรายต่อหัวใจ ซึ่งอาจจะขาดเลือดทันทีถ้าเริ่มออกกำลังกายหนักตั้งแต่เริ่มแรก\n\n· ป้องกันอาการหน้ามืด เป็นลม ล้มลงโดยไม่รู้สึกตัวเนื่องจากเลือดไปเลี้ยงสมองไม่พอ ถ้าเริ่มออกกำลังกายหนักตั้งแต่เริ่มต้น\n\n· ลดโอกาสบาดเจ็บของข้อต่อ เอ็นและกล้ามเนื้อเนื่องจากมีการปรับตัวในการใช้งานอย่างต่อเนื่องจากเบาไปหนัก','http://34.126.141.128/images/feed/','data:image/jpeg;base64,','2021-11-11'),(4,'ผลดีของการออกกำลังกาย','· การออกกำลังจะทำให้รูปร่างดูดี กล้ามเนื้อแข็งแรง ลดไขมันที่สะสมตามส่วนต่างๆของร่างกาย ช่วยลดน้ำหนัก\n\n· ป้องกันโรคหัวใจ หัวใจแข็งแรงขึ้น ลดโอกาสเกิดโรคเส้นเลือดหัวใจตีบ และกล้ามเนื้อหัวใจตาย\n\n· ความดันโลหิตลดลง ลดโอกาสเกิดความดันโลหิตสูง และเส้นเลือดในสมองแตกหรือตีบตัน\n\n· ป้องกันโรคอ้วน\n\n· ป้องกันโรคกระดูกพรุน เสริมสร้างกระดูกให้แข็งแรงขึ้น\n\n· ป้องกันและรักษาโรคเบาหวาน\n\n· ป้องกันโรคภูมิแพ้1\n\n· เพิ่มภูมิต้านทานโรค\n\n· ลดไขมัน ในเลือด ทำให้โคเลสเตอโรล, ไตรกลีเซอไรด์, LDLลดลง\n\n· เพิ่มไขมันดี ในเลือด คือ HDL ที่ช่วยป้องกันโรคหัวใจ\n\n· ทำให้ร่างกายสดชื่น ลดความเครียด จากการที่สมองผลิตฮอร์โมนชนิดหนึ่งชื่อ เอนดอร์ฟิน ออกมาในขณะออกกำลังกาย ฮอร์โมนนี้มีลักษณะคล้ายมอร์ฟีน จึงทำให้รู้สึกเป็นสุข\n\n· ช่วยให้นอนหลับสบายและหลับสนิท\n\n· ระบบย่อยอาหารดีขึ้น ระบบขับถ่ายดีขึ้น ช่วยให้ท้องไม่ผูก เพราะลำไส้มีการขยับตัวดีขึ้น',NULL,'data:image/jpeg;base64,','2021-11-13'),(6,'Test','Test',NULL,'data:image/jpeg;base64,','2021-11-15');
